import React from "react";

function PanelHeader(props) {
  // Estilo en línea para el estante de libros
  const bookshelfStyle = {
    position: 'absolute',
    top: '0',
    right: '0',
    width: '150px', // Ajusta el tamaño según la imagen
    height: 'auto',
  };

  const headerStyle = {
    position: 'relative',
    padding: '20px',
    backgroundColor: '#f5f5f5',
    borderBottom: '1px solid #ddd',
    marginRight: '160px', // Ajusta según el tamaño del estante
  };

  return (
    <div className="panel-header" style={headerStyle}>
      <div className="bookshelf-container" style={bookshelfStyle}>
        <img 
          src="https://images.unsplash.com/photo-1590704152861-1a2de7087b3f" 
          alt="Estante de Libros" 
          style={{ width: '100%', height: 'auto' }} 
        />
      </div>
      {props.content}
    </div>
  );
}

export default PanelHeader;
